import React,{useEffect,useState} from "react";
import {useParams} from "react-router-dom";
import axios from"axios";
import {CicrcularProgress} from "@material-ui/core";


const Todo =()=>{

    const {id}=useParams();

	const [tododetails,setTododetails] = useState();





	        useEffect(()=>{


			 axios.get(`https://jsonplaceholder.typicode.com/todos/${id}`).then((res)=>{

						                        const responseTododetails=res.data;
						                        setTododetails(responseTododetails);



						                });







		},[]);

	const {id:todoid,title,completed}=tododetails||{}





return( 

	<React.Fragment>

	tododetails?(

		<div>


	<h1> To do number {id}</h1>




	<h2>Id: {todoid}</h2>
	<h2>Title: {title}</h2>
	<h2>{`Completion: ${completed}`}</h2>
	</div>
	):(

		<CircularProgress/>

	)



	</React.Fragment>
);


}


export default Todo;
